import "./moviesCard.css";

export default function MovieCard(props) {
  const { movie } = props;

  return (
    <li className="movie-card">
      <img
        src={`https://image.tmdb.org/t/p/w500/${movie.poster_path}`}
        alt={movie.title}
      />
      <p>{movie.title}</p>
      <p>{Math.round(movie.vote_average)}</p>
    </li>
  );
}
